('1252','15','7181','Finca Amrani',Null,'Repräsentative Natursteinfinca mit Gästehaus auf 10.400 m² Kulturgrundstück  mit Panoramablick in Portól','8213','Diese etwa 300 Jahre alte Finca wurde umfangreich mit modernster Technik zu einer Luxus-Finca umgebaut. Der parkähnliche Garten mit großzügigen Rasenflächen und außergewöhnlicher mediterraner Bepflanzung ist eine Oase für Naturliebhaber. Die Finca hat eine Wohnfläche von 417 m² und verteilt sich auf 2 Ebenen plus Gästehaus. Das Haupthaus besteht aus dem Erdgeschoß mit Eingangshalle, Wohnzimmer, Fernsehzimmer, Esszimmer, Küche, Hauswirtschaftsraum, Abstellräumen und einem Schlafzimmer mit Badezimmer en Suite und dem Obergeschoß mit 2 Hauptschlafzimmer mit Badezimmer und Ankleidezimmer, 3 Schlafzimmer mit 3 Bäder und Büro. Das separate Gästehaus mit Schlaf- /Wohnbereich, Küche und Bad besitzt eine idyllische Terrasse mit Zugang zum Garten. Die Finca verfügt über freie und überdachte Terrassen, Grillplatz, Teich, Schwimmbad, ist hochwertig ausgestattet und besitzt alle Extras.','8214','2300000','106','2009-02-25 15:04:05','106','2009-02-25 15:05:27',Null,'353','110','197',1,'1','0',Null,Null,Null,'8215',Null,'0','0','0',Null,'2015-08-06 15:39:55',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'8216',Null,'8217',Null,'8218',Null,'8219',Null,'8220','0',0,'5');
